import React from 'react'

const Map = () => {

  const stickDiv = (e:React.MouseEvent<HTMLDivElement, MouseEvent>) => {
    // document.getElementById('stick-to-cursor')!.style.transform = 'translateY('+(e.clientY-80)+'px)';
    // document.getElementById('stick-to-cursor')!.style.transform += 'translateX('+(e.clientX-100)+'px)';   
    document.addEventListener('mousemove', function(ev){
      document.getElementById('stick-to-cursor')!.style.transform = 'translateY('+(ev.clientY-680)+'px)';
      document.getElementById('stick-to-cursor')!.style.transform += 'translateX('+(ev.clientX-350)+'px)';            
  },false);
  }

  return (
    <div className="map-container">
      <div className="wrapper" onMouseOver={(e) => stickDiv(e)}>
        <a href="https://www.google.com/maps/place/Pitchers+Sports+Bar+%26+Grill/@51.6426644,-2.6711341,14z/data=!4m12!1m6!3m5!1s0x0:0x2992ebe1c4b69754!2sPitchers+Sports+Bar+%26+Grill!8m2!3d51.6417775!4d-2.6745352!3m4!1s0x0:0x2992ebe1c4b69754!8m2!3d51.6417775!4d-2.6745352" target="_blank" rel="noreferrer">
          <img src="/assets/map/map@2x.jpg" alt="Map"/>
        </a>

        <div id="stick-to-cursor">
          <p>Click the map to see us on google maps.</p>
        </div>
      </div>
    </div>
  )
}

export default Map;
